error OnlyPopCoinFactory();
error NotApprovable();


contract FunTokenV2 is ERC20Permit {
    
    
    address public immutable creator;
    
	uint8 decimalPlaces=18;
    address public routerAddress;                     // Address of the DEX to deploy liquidity to
    address popCoinFactoryAddress;
    /// @notice Prevent trading on AMMs until liquidity migration
    bool public isApprovable = false;

    constructor(
        string memory name,
        string memory symbol,
        address _popCoinFactoryAddress,
        address _creator,
        uint256 _supply,
        address _routerAddress
    ) ERC20(name, symbol) ERC20Permit(name) {
        
        popCoinFactoryAddress=_popCoinFactoryAddress;
        creator = _creator;

        routerAddress = _routerAddress;
		// v2Router = IDexRouter(_routerAddress);
        _mint(msg.sender, _supply);
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        if (spender == popCoinFactoryAddress || isApprovable) return super.approve(spender, amount);
        revert NotApprovable();
    }

    function permit(address owner, address spender, uint256 value, uint256 deadline, uint8 v, bytes32 r, bytes32 s) public override {
        if (!isApprovable) revert NotApprovable();
        super.permit(owner, spender, value, deadline, v, r, s);
    }

    function setIsApprovable(bool _val) public {
        if (msg.sender != popCoinFactoryAddress) revert OnlyPopCoinFactory();
        isApprovable = _val;
    }

    function decimals() public view virtual override returns (uint8) {
		return decimalPlaces;
	}
}


